  ('518', '78', 'HHS000518', '358元120瓶米枫源定制水-源自青岛崂山', '+', '0', '0', '', '5000', '0.000', '598.00', '358.00', '0.00', '0', '0', '1', '', '为宝宝满月、家人生日、汽车4S店、公司或店铺开业、乔迁及各种庆典而提供的私人定制。', '<p class=\"p\" style=\"text-indent:21.0000pt;\">\r\n	青岛米枫源矿泉水有限公司是一家集矿泉水研发、生产、销售于一体的企业，产品水源地为道家文化发源地、中国第一瓶矿泉水生产地、世界三大水系之一的青岛崂山，凭借崂山独有的珍稀资源、世界一流的水处理工艺、与时俱进的管理思维、严谨成熟的商业模式、独特创新的市场策略，使得米枫源公司自成立以来深得渠道市场和消费者的认可。\r\n</p>\r\n<p class=\"p\" style=\"text-indent:16.5000pt;\">\r\n	公司自成立以来专注于瓶装定制水的研究与服务，产品将企业logo、文化或个人信息等印制于标签上，形成企业或个人的专属用水，被客户广泛用于来宾接待、活动宣传、礼品赠送、开业庆典、生日庆典、宝宝满月庆典、朋友聚会等用途，有效提升了企业及个人形象。现已在酒店、宾馆、学校、金融、地产、会展、汽车4S店、茶楼、会所、社区等多个行业和渠道提供产品与服务，得到了广大消费者的一致好评。\r\n</p>\r\n<p class=\"p\" style=\"text-indent:16.5000pt;\">\r\n	此款水风格为公司最经典瓶型，棱角分明的方形，为公司客户选择最多的产品，容量为350ml；标贴可以根据消费者的需求专门定做，消费者提出自己的要求或提供相应的图片，我们可以免费为您设计标签，尽最大的努力满足消费者的要求。\r\n</p>\r\n<p class=\"p\" style=\"text-indent:16.5000pt;\">\r\n	三、付款成功后请联系：1、客服电话：&nbsp;0532-55576668&nbsp;&nbsp;2、客服QQ：&nbsp;2823503083@qq.com&nbsp;&nbsp;发送图片及文字内容&nbsp;&nbsp;3、将您收货的详细地址发于客服，产品将于20个工作日以物流形似发送至您的地址。\r\n</p>\r\n<img src=\"/business/includes/kindeditor/php/../../../uploads/98/image/20160504/20160504145229_19400.jpg\" alt=\"\" /><img src=\"/business/includes/kindeditor/php/../../../uploads/98/image/20160504/20160504145229_30237.jpg\" alt=\"\" /><img src=\"/business/includes/kindeditor/php/../../../uploads/98/image/20160504/20160504145229_95803.jpg\" alt=\"\" /><img src=\"/business/includes/kindeditor/php/../../../uploads/98/image/20160504/20160504145230_67680.jpg\" alt=\"\" /><img src=\"/business/includes/kindeditor/php/../../../uploads/98/image/20160504/20160504145230_97083.jpg\" alt=\"\" /><img src=\"/business/includes/kindeditor/php/../../../uploads/98/image/20160504/20160504145230_13852.jpg\" alt=\"\" />', 'business/uploads/98/20160504145238ioackflk.jpg', 'business/uploads/98/20160504145238ioackflk.jpg', 'business/uploads/98/20160504145238ioackflk.jpg', '1', '', '1', '1', '0', '0', '0', '11000', '0', '0', '1', '0', '0', '0', '0', '1463471424', '0', ''